【水中ハイスピンポンプ】<br><br>

吐出し口径mm： 50<br> 
出力kW： 0.4<br><br> 

異物通過断面を特に考慮し、過酷な現場にも対応できるスパイラルケーシングの普及タイプです。<br><br>

アルミダイカスト・耐水性特殊ウレタンゴムなど軽い材料を随所に採用、軽くて強い設計です。<br><br>

ハイギャップ構造のハイスピン形羽根車の採用で、さらに摩耗に強くなり<br>
