【用途】<br>
１.一般土木・建築工事の排水用。<br>
２.雨水・湧水・溜り水の排水用。<br>
３.地下室・各種ピットなどの排水用。<br>
４.一般の揚水・排水用。<br><br>

水中ハイスピンポンプ<br><br>

【吐出し口径mm】： 40・50<br> 
【出力kW】： 0.25 - 0.75 <br><br>

●実績と信頼を誇るLB型をベースに、ハイギャップ構造のハイスピン形の羽根車の採用で、<br>
さらに摩耗に強くなり、また摩耗しても性能低下が少ない羽根車特性となりました。<br>
砂などによる〈ロック〉が少ない設計です。<br><br>

●吐出し方向「上」「横」を変更可能、横引き時のホースの折れ曲がりを防止します。<br>
袋ナットを緩めるだけで脱着可能。<br><br>

●厳選した耐摩耗性のある複合材の採用により、質量9.5kgの軽量化及びA4サイズの紙と<br>
ほぼ同等という小形化を実現しました。<br><br>

●ポンプ部はボックスレンチ1本で分解でき、メンテナンスか容易になりました。<br>
